import java.io.*;
import java.util.*;

class template
{
	public int gcd(int a, int b)
	{
		while(b != 0) {
			int t = b;
			b = a % b;
			a = t;
		}
		return a;
	}

	public static void main(String[] args) throws Exception
	{
		template t = new template();
		t.go();
	}

	public void go() throws Exception
	{
		Scanner s = new Scanner(System.in);
		int N = s.nextInt();
		while(N-->0)
		{
			int a = s.nextInt();
			int b = s.nextInt();
			int g = gcd(a, b);
			System.out.println(g);
		}
	}
}

